	getUivInfo = function(provCode){
		var provCode = transKey[provCode];
		var returnObj = {"univ":null};
		for(var i = 0, len = uivData.length; i < len; i ++){
			if(provCode == uivData[i]["key"] ){
				returnObj = uivData[i];
				break;
			}
		}
		return returnObj.univ;
	};
	
	var clgTrans = new Interface("/personinfo/aj_collegeinfo.php","ajax");
	
	getClgInfo = function(uivid,returnfun){
		clgTrans.request({
			"GET" : {
				"schoolid"   : uivid
			},
			"onSuccess" : function(json){
				returnfun(json);
			},
			"onError" : function(){
				
			},
			"onFail" : function(){
				
			}
		});
	};
	App.University = function(provDom,uivDom,clgDom,uivValue,clgValue){
		this.provDom  = provDom;
		this.uivDom   = uivDom;
		this.clgDom   = clgDom;
		this.uivValue = uivValue;
		this.clgValue = clgValue;
		this.init();
	};
	(function(_p){
		_p.init = function(){
			Core.Events.addEvent(
				this.provDom,
				(function(){
					if(this.provDom.value == "1001"){
						return false;
					}
					this.uivValue = 0;
					this.clgValue = 0;
					this.loadUiv();
					this.loadClg();
				}).bind2(this),
				"change"
			);
			Core.Events.addEvent(
				this.uivDom,
				(function(){
					this.uivValue = this.uivDom.value;
					this.clgValue = 0;
					this.loadUiv();
					this.loadClg();
				}).bind2(this),
				"change"
			);
		};
		_p.disp = function(){};
		_p.loadUiv = function(){
			var uivinfo = getUivInfo(this.provDom.value) || [];
			var uivOps = this.uivDom.options;
			while(uivOps.length){
				this.uivDom.remove(0);
			}
			uivOps[0] = new Option($CLTMSG['CX0172'], 0);
			for(var i = 0, len = uivinfo.length; i < len; i ++){
				uivOps[uivOps.length] = new Option(uivinfo[i].name,uivinfo[i].id);
			}
			this.uivDom.value = this.uivValue;
			
		};
		_p.loadClg = function(){
			var clgOps = this.clgDom.options;
			while(clgOps.length){
				this.clgDom.remove(0);
			}
			clgOps[0] = new Option($CLTMSG['CX0172'], 0);
			if(this.uivValue){
				getClgInfo(this.uivValue, (function(_this){
					return function(clginfo){
						(function(){
							for(var i = 0, len = clginfo.length; i < len; i ++){
								clgOps[clgOps.length] = new Option(clginfo[i], i);
							}
							this.clgDom.value = this.clgValue;
						}).apply(_this);
					}
				})(this));
			}
			
		};
		_p.loadNewData = function(uiv,clg){
			this.uivValue = uiv;
			this.clgValue = clg;
			this.loadUiv();
			this.loadClg();
		};
	})(App.University.prototype);
